sys_variable_value.value:
(function execute(inputs, outputs) {
    
    var vendorUtils = new VendorUtils();
    var vendorDetails = vendorUtils.getVendorsById(inputs.vendor_id);
    if(vendorDetails){
        outputs.id = inputs.vendor_id;
        outputs.name = vendorDetails.ven_name;
        outputs.contact_number = vendorDetails.ven_contact_number;
        outputs.email = vendorDetails.ven_email;
        
    }
})(inputs, outputs);

